import React, { Component } from 'react';

import "./Card.css";

class Card extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <div className="card">
        <div className="card-content">
          <p className="card-projectName">
            {this.props.projectName}
          </p>
          <p className="card-intro">
          {this.props.intro}
          </p>
          <button>Detail</button>
        </div>
      </div>
    );
  }
}

export default Card;
